import styled from "styled-components";

const StyledDiv = styled.div`
  background-color: #e8ffee;
  padding: 20px;
  display: flex;
  justify-content: space-between;
`;

const StyledAnchor = styled.a`
  cursor: pointer;
  font-weight: 500;
  font-size: 13px;
`;

export { StyledDiv, StyledAnchor };
